import React,{useState} from 'react';
import {Link} from 'react-router-dom';

const Signup=()=>{
	const [name,setName]=useState("")
	const [password,setPassword]=useState("")
	const [email,setEmail]=useState("")
	const PostData=()=>{
		fetch("hhtp://localhost:5000/signup",{
			method:"post",
			headers:{ 
				"Content-Type":"application/json"
			},
			body:JSON.stringify({
			name,
			password,
			email
		})
		})
	}
	return(
		<div className="mycard">
			<div className="card auth-card input-field">
		        <h1 className="brand-logo">Instagram</h1>
		        <input type="text" placeholder="Name" value={name} onChange={(event)=>setName(event.target.value)}/>
		        <input type="text" placeholder="Email" value={email} onChange={(event)=>setEmail(event.target.value)}/>
		        <input type="text" placeholder="Password" value={password} onChange={(event)=>setPassword(event.target.value)}/>
		        <a className="waves-effect waves-light btn #1976d2 blue darken-2" onClick={()=>PostData}>Submit</a>
		        <Link to="/signin"><h5>Already have an account?</h5></Link>
	      </div>
		</div>
		)
}

export default Signup
